import React, { useState } from 'react'

function UseStateComponent() {
    const [userInp,setUserInp]=useState({name:'',mail:''})

    const setValuesFunc=(ele)=>{
        setUserInp(ele.tar)
    }

    return (
        <div>
            <div className='container'>
                <form>
                    <div className='form-floating'>
                        <input className='form-control'
                            type='text'
                            placeholder=''
                            value={userInp.name}
                            onChange={(e)=>setValuesFunc(e)}
                        />
                        <label className='form-floating-label'>Enter your name</label>
                    </div>
                    <div className='form-floating'>
                        <input className='form-control'
                            type='email'
                            placeholder=''
                            value={userInp.mail}
                            onChange={(e)=>setValuesFunc(e)}
                        />
                        <label className='form-floating-label'>Enter your name</label>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default UseStateComponent
